class PublishStatus(Enum):
    DRAFT = "draft"
    PUBLISHED = "published"
    VALIDATED = "validated"
    FAILED = "failed"

class Submission:
    def __init__(self, submission_id: str, agency: str, publish_status: PublishStatus):
        self.submission_id = submission_id
        self.agency = agency
        self.publish_status = publish_status
        self.created_at = datetime.datetime.now()
        self.updated_at = datetime.datetime.now()
        self.creator = "default_user"

    def update_publish_status(self, new_status: PublishStatus):
        self.publish_status = new_status
        self.updated_at = datetime.datetime.now()
        logger.info(f"Submission {self.submission_id} status updated to {new_status}")

class FABSSubmission(Submission):
    def __init__(self, submission_id: str, agency: str, publish_status: PublishStatus, flexfields: Dict):
        super().__init__(submission_id, agency, publish_status)
        self.flexfields = flexfields
        self.is_historical = False
        self.derived_fields = {}

    def derive_fields(self):
        self.derived_fields = {
            "FundingAgencyCode": self.flexfields.get("FundingAgency", ""),
            "OfficeName": f"Office_{self.flexfields.get('OfficeCode', '000')}"
        }
        logger.info(f"Derived fields for submission {self.submission_id}")

class DABSSubmission(Submission):
    def __init__(self, submission_id: str, agency: str, publish_status: PublishStatus, fpds_data: Dict):
        super().__init__(submission_id, agency, publish_status)
        self.fpds_data = fpds_data

class BrokerUser:
    def __init__(self, user_id: str, role: str):
        self.user_id = user_id
        self.role = role
        self.permissions = self._set_permissions(role)

    def _set_permissions(self, role: str) -> List[str]:
        if role == "agency_user":
            return ["submit_fabs", "view_dabs"]
        elif role == "developer":
            return ["manage_submissions", "update_rules"]
        elif role == "admin":
            return ["manage_users", "reset_environments"]
        else:
            return ["view_submissions"]

    def can_perform(self, action: str) -> bool:
        return action in self.permissions

class ValidationRule:
    def __init__(self, rule_id: str, description: str, error_message: str):
        self.rule_id = rule_id
        self.description = description
        self.error_message = error_message

class ValidationEngine:
    _instance = None

    def __new__(cls):
        if cls._instance is None:
            cls._instance = super().__new__(cls)
            cls._instance.rules = []
        return cls._instance

    def add_rule(self, rule: ValidationRule):
        self.rules.append(rule)
        logger.info(f"Added validation rule: {rule.rule_id}")

    def validate_submission(self, submission: Submission) -> List[str]:
        errors = []
        for rule in self.rules:
            if self._check_rule(rule, submission):
                errors.append(rule.error_message)
        return errors

