class BrokerUIManager:
    def __init__(self):
        self.current_design = "old_design"
        self.design_styles = {
            "new_broker": {"primary_color": "#4A90E2", "font": "Arial"},
            "old_design": {"primary_color": "#333333", "font": "Times New Roman"}
        }

    def update_design(self, new_style: str):
        if new_style in self.design_styles:
            self.current_design = new_style
            logger.info(f"UI design updated to {new_style}")
        else:
            logger.warning(f"Design style {new_style} not found")

    def generate_user_test_report(self, agency: str, test_results: Dict) -> str:
        report = f"User Testing Report for {agency}\n"
        for test, result in test_results.items():
            report += f"- {test}: {'PASS' if result else 'FAIL'}\n"
        return report

