class HistoricalDataLoader:
    def __init__(self):
        self.loaded_data_sets = set()

    def load_fabs_data(self, include_columns: List[str]) -> bool:
        required_columns = ["FREC", "OfficeCode", "FundingAgencyCode"]
        if all(col in include_columns for col in required_columns):
            self.loaded_data_sets.add("fabs")
            logger.info("Historical FABS data loaded with required columns")
            return True
        logger.error("Missing required columns for FABS data load")
        return False

    def load_fpds_data(self, year: int) -> bool:
        if 2007 <= year <= datetime.datetime.now().year:
            self.loaded_data_sets.add(f"fpds_{year}")
            logger.info(f"FPDS data for {year} loaded")
            return True
        logger.error(f"Invalid year {year} for FPDS data load")
        return False

class FileGenerator:
    @staticmethod
    def generate_d_file(submission: Submission, cache: bool = True) -> str:
        file_content = f"D File for {submission.submission_id}"
        if cache:
            logger.info(f"Generated and cached D file for {submission.submission_id}")
        else:
            logger.info(f"Generated (uncached) D file for {submission.submission_id}")
        return file_content

    @staticmethod
    def validate_file_extension(filename: str, allowed_extensions: List[str]) -> bool:
        valid = any(filename.endswith(ext) for ext in allowed_extensions)
        if not valid:
            logger.warning(f"Invalid file extension for {filename}")
        return valid

